declare module 'dayjs' {
  import { Dayjs, extend, tz, unix } from 'dayjs';
  export const Dayjs: Dayjs;
  export const extend: typeof extend;
  export const tz: typeof tz;
  export const unix: typeof unix;

  declare namespace dayjs {
    export interface Extendable extends Dayjs {
      extend: typeof extend;
      tz: typeof tz;
      unix: typeof unix;
    }
  }

  export default Dayjs;
}

